import React, { Component } from "react";
import { Form, Input, Select } from "antd";

const { Option } = Select;
const formItemLayout = {
    labelCol: {
      xs: { span: 24 },
      sm: { span: 5 },
    },
    wrapperCol: {
      xs: { span: 24 },
      sm: { span: 12 },
    },
  };
class AddCars extends Component {
  render() {
    return (
      <div>
        <Form>
            <Form.Item label="ประเภทรถ">
                <Input></Input>
            </Form.Item>
        </Form>
      </div>
    );
  }
}

export default AddCars;
